import { useState, useEffect } from "react"
import "./BookingForm.css"

export const FutureBookings = () => {

  const [requests, setRequest] = useState([])

  useEffect(
    () => {
      fetch(`http://localhost:8088/requests?isAccepted=true&_sort=startDate`)
        .then(response => response.json())
        .then((requestInfo) => {
          setRequest(requestInfo)
        })
    }, []
  )

  return (
    <div className="myrequests">
      <h2 className="futureBookingsHeader">Future Bookings</h2>
      <div className="requestBox">
        {requests.map(request => {
          return (<>
            <div className="requestInfo" key={`requests--${request.id}`}>
              <div>Band Name: {request.bandName}</div>
              <div>{request.startDate}</div>
              <div>{request.endDate}</div>
              <div>{request.phoneNumber}</div>
              <div></div>
            </div>
          </>)
        })}

      </div>
    </div>
  )

}
